    true,nt"url": null,nt"notes": "The information given in this file represents
    GHG emissions and corresponding emission rates for California flash and dry steam
    geothermal power plants. This stage of the life cycle is the fuel use component
    of the fuel cycle and arises during plant operation. Despite that no fossil fuels
    are being consumed during operation of these plants, GHG emissions nevertheless
    arise from GHGs present in the geofluids and dry steam that get released to the
    atmosphere upon passing through the system. Data for the years of 2008 to 2012 are
    analyzed.tttnttttttttttnttttttttttnttttttttttnttttttttttn",nt"license_title":
